//ANIMACION DE INTRO
int (*animacion[8])[70][67] = { &introframe1, &introframe2, &introframe3, &introframe4, &introframe5, &introframe6, &introframe7, &introframe8 };

//DIBUJADO DE INTRO
void dibujar_frame(int frameIndex, int x, int y) {
    for (int fila = 0; fila < 70; fila++) {
        for (int columna = 0; columna < 67; columna++) {
            ubicar(x + columna, y + fila);
            asignarcolor((*animacion[frameIndex])[fila][columna]);
            cout << char(219);
        }
    }
}

//FUNCION PARA REPRODUCIR LA ANIMACION DE INTRO
void reproducir_animacion(int x, int y) {
    for (int introframe = 0; introframe < 8; introframe++) {
        dibujar_frame(introframe, x, y);
        Sleep(5);
    }
}

