void dibujar_stageclear(int stageclearFilas, int stageclearColumnas, int stageclear[][72], int posx, int posy) {
    for (int fila = 0; fila < stageclearFilas; fila++) {
        for (int columna = 0; columna < stageclearColumnas; columna++) {
            int x = posx + columna;
            int y = posy + fila;
            if (x >= 0 && x < 300 && y >= 0 && y < 100) {
                ubicar(x, y);
                asignarcolor(stageclear[fila][columna]);
                cout << char(219);
            }
        }
    }
}
//DESPLAZO DEL TEXTO "STAGE"
void deslizar_izquierda(int stage[17][72], int filas, int columnas, int destinoX, int destinoY) {
    for (int x = -columnas; x <= destinoX; x += 5) {
        dibujar_stageclear(filas, columnas, stage, x, destinoY);
        Sleep(5);
    }
    dibujar_stageclear(filas, columnas, stage, destinoX, destinoY);
}
//DESPLAZO DEL TEXTO "CLEAR"
void deslizar_derecha(int clear[17][72], int filas, int columnas, int destinoX, int destinoY) {
    for (int x = 300; x >= destinoX; x -= 5) {
        dibujar_stageclear(filas, columnas, clear, x, destinoY);
        Sleep(5);
    }
    dibujar_stageclear(filas, columnas, clear, destinoX, destinoY);
}
