//DIBUJADO DE LOS TEXTOS Y LAS ESCENAS
void dibujar_cutscenetext(int frameIndex, int x, int y) {
    for (int fila = 0; fila < 36; fila++) {
        for (int columna = 0; columna < 296; columna++) {
            ubicar(x + columna, y + fila);
            asignarcolor((*cutscenetext[frameIndex])[fila][columna]);
            cout << char(219);
        }
    }
}
